import Header from "./components/header";
import Sidebar from "./components/menu";
import { MenuContextProvider } from "./contexts/menuContext";

function App() {

  return (
    <div>
      <MenuContextProvider>
        <Header />
        <div style={{width: '100%', display: 'flex'}}>
          <Sidebar />
          <div style={{backgroundColor: 'blue', width: '100%'}}>

          </div>
        </div>
      </MenuContextProvider>
    </div>
  );
}

export default App;
